pragma solidity ^0.4.21;

import "./Ownable.sol";

contract ToriFactory {
  uint256 private INIT_TORIS = 3;
  uint256 private DNA_LIMIT = 10**3;

  struct Tori {
    uint256 dna;
    /* string[] words; */
  }

  Tori[] toris;

  mapping (address => uint256[]) addrToToris;
  mapping (uint256 => address) toriToAddr;
  mapping (address => uint256) addrToToriCount;

  event NewTori(address indexed _address, uint256[] _toriDnas);

  function _generateRandomDna(uint i) private view returns (uint256) {
    return uint(keccak256(now, msg.sender, i)) % DNA_LIMIT;
  }

  function generateNewTori() public returns (bool success) {
    // Generate three new toris
    require (addrToToriCount[msg.sender] == 0);
    uint256[] memory ids = new uint256[](INIT_TORIS);
    for (uint i = 0; i < INIT_TORIS; i++) {
      uint256 dna = _generateRandomDna(i);
      uint256 id = toris.push(Tori(dna)) - 1;
      addrToToris[msg.sender].push(id);
      toriToAddr[id] = msg.sender;
      ids[i] = id;
    }
    addrToToriCount[msg.sender] += INIT_TORIS;

    /* emit NewTori(msg.sender, ids); */
    return true;
  }

  function getToriIds() public view returns (uint256[] toriIds){
    return addrToToris[msg.sender];
  }

  function getToriInfo(uint256 _toriId) public view returns (uint256 toriId, uint256 toriDna) {
    require(msg.sender == toriToAddr[_toriId]);
    Tori memory tori = toris[_toriId];
    return (_toriId, tori.dna);
  }

  function getToriCount() public view returns (uint256 toriCount){
    return addrToToriCount[msg.sender];
  }
}
